import React, { useState, useEffect } from 'react'
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import { Container } from '../styled/layoutStyle'
import firebase from '../config'
import { serverTimestamp } from 'firebase/firestore'

function Calculate() {

    const [Start, setStart] = useState(0)
    const [End, setEnd] = useState(0)
    // const [timestamp,settimestamp] = useState()
    const firebaseRef = firebase.firestore().collection('History')

    
    const pushData = (e) =>{
        e.preventDefault();

        const dataObj={
            start:`${Start}`,
            end:`${End}`,
            timestamp : serverTimestamp()
        };
        
        firebaseRef.doc().set(dataObj)

    }




    
    return (
        <Container>
            <h1>Prime number Calculate</h1>
            <Form onSubmit={pushData}>
                <Form.Group controlId='Start'>
                    <Form.Label>Start</Form.Label>
                    <Form.Control type="textfield" pattern="[0-9]{2}" min="10" max="9" oninput="this.value.length<this.maxLength?this.min=Math.pow(10, this.value.length):this.min=0" onChange={e => setStart(e.target.value)} required/>
                </Form.Group>
                <Form.Group controlId='End'>
                    <Form.Label>End</Form.Label>
                    <Form.Control type="textfield" pattern='[0-9]{4}' onChange={e => setEnd(e.target.value)} required/>
                </Form.Group>
                <Button variant="success" size="lg" block="block" type="submit">
                    Calculate
                </Button>
            </Form>
        </Container>
    )
}

export default Calculate
